	VALUES( 240111044331051300, UUID(), 14956, '深圳市',  14957, '福田区', '深业花园', '深业花园', '深圳市福田区福中路106号', NULL, '深业花园是深业控股有限公司和深业集团（深圳）有限公司开发建设的园林式智能化高尚住宅小区，位于深圳市福田中心区东北片，东邻彩田北路、西邻海田路、南邻福中路、北面与中银花园一路之隔。深业花园由5栋楼高12层和5栋楼高22～30层主建筑组成，另设有楼高3层的会所和幼儿园各一栋。停车库设在地下，实行人车分流。小区的配套设施完善，布局合理，10栋住宅楼沿周边布置和首层架空6米，构成一个2万多平方米的园林绿地和庭园大空间。', NULL, NULL, NULL, NULL, NULL, NULL,NULL, 682, 1,NULL,'2',UTC_TIMESTAMP(), NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL,NULL,'0', 179900, 179901, UTC_TIMESTAMP(), 999992);
