	VALUES( 240111044331051303, UUID(), 14956, '深圳市',  14957, '福田区', '风临左岸', '风临左岸', '深圳市福田区农林路53号', NULL, '风临左岸是深业鸿基南方（集团）有限公司开发建设的园林式智能化高尚住宅小区，位于深圳市福田农林路与深南市场交汇处。风临左岸由3栋组成，A栋3个单元楼高18层，B栋1个单元楼高24层，C栋2个单元楼高18层。方型顶层，外观色调优雅，区中心有大面积绿化带，加上竹林小溪绿地等。停车场设在地下，小区的配套设施完善，布局合理，3栋住宅楼沿周边布置和首层架空6米，构成一个1.5万多平方米的园林绿地和庭院大空间。', NULL, NULL, NULL, NULL, NULL, NULL,NULL, 423, 1,NULL,'2',UTC_TIMESTAMP(), NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL,NULL,'0', 179900, 179901, UTC_TIMESTAMP(), 999992);
